import React from "react";
// Import Swiper React components
import { Swiper, SwiperSlide } from "swiper/react";
import img1 from "../img/slider_header_1.jpeg";
import img3 from "../img/slider_header_3.jpeg";
import img2 from "../img/slider_header_2.jpeg";

// Import Swiper styles
import "swiper/css";
import "swiper/css/effect-fade";
import "swiper/css/navigation";
import "swiper/css/pagination";

import "./styles.css";

// import required modules
import { EffectFade, Navigation, Pagination } from "swiper";

const SwiperSlider = () => {
  return (
    <>
      <Swiper
        loop={true}
        spaceBetween={30}
        effect={"fade"}
        navigation={true}
        pagination={{
          clickable: true,
        }}
        dotsWrapperStyle={ {marginBottom: 20} }
        modules={[EffectFade, Navigation, Pagination]}
        className="mySwiper"
      >
        <SwiperSlide>
          <img src={img1} alt='sto_news'/>
        </SwiperSlide>
        <SwiperSlide>
          <img src={img3} alt='sto_news'/>
        </SwiperSlide>
        <SwiperSlide>
          <img src={img2} alt='sto_news'/>
        </SwiperSlide>
      </Swiper>
    </>
  );
};

export default SwiperSlider;
